Now that you're all grown up and have a ship of your own, your desire for great treasure brings you back to a time of boyhood memories when you and the crew of a great pirate ship took to land out of the elements. Stranded by the reef, the stay on the island was much longer than expected. The captain ordered the treasure to be buried. And now it's your turn to be a great pirate and claim the booty for your own.
